    <script>
        function myfunction(obj){
            var id = obj.id;

            var emissions = {Malta:"5.5",Sweden:"5.5",Romania:"5.9",Latvia:"6.1",Croatia:"6.2",Hungary:"6.6"
            ,France:"7.2",Portugal:"7.2",Italy:"7.3",Lithuania:"7.3",Spain:"7.7",
            UnitedKingdom:"7.7",Slovakia:"8",Slovenia:"8.5",Bulgaria:"8.8",Denmark:"8.8",Greece:"9.2"
            ,Austria:"9.6",Finland:"10.4",Belgium:"10.5",Poland:"11",Germany:"11.3",Cyprus:"11.6",
            Netherlands:"12",CzechRepublic:"12.3",Ireland:"13.3",Estonia:"16",Luxembourg:"20"};

            var not_member = ["Norway","Switzerland","Bosnia and Herzegovina","Serbia","Montenegro",
                "Kosovo","North Macedonia","Albania","Moldova","Ukraine","Belarus","Turkey",
            "Georgia","Armenia"];

            var paragraph = document.getElementById("output");
            var country = document.getElementById(id);
            var name = obj.getAttribute("name");
            var co2 = emissions[name];
            country.style.cssText = "opacity: 0.5 !important;"
            if(not_member.includes(name)){
                paragraph.innerHTML = name+": -"; 
            }else{
                paragraph.innerHTML = name+": "+co2+" Tons"; 
            }
            //paragraph.innerHTML = name+": "+co2+" Tons"; 
        }
        function myfunction2(obj){
            var id = obj.id;
            var color = document.getElementById(id).style.fill;
            var country = document.getElementById(id);
            var color2 = $(id).css("fill");
            if(id == "TR" ){
                var grey = "#E4E4E4";
                country.style.cssText = "fill:"+grey+"!important;"
                country.style.cssText = "opacity: 1 !important;"
            }else if(id =="HR"){
                var green = "#DAF1A5";
                country.style.cssText = "fill:"+green+"!important;"
                country.style.cssText = "opacity: 1 !important;"
            }else{
                country.style.cssText = "fill:"+color2+"!important;"
            }
        }
